import { Base } from "../../Base";

class NavItem extends React.Component {
    
    render() { 
        alert(this.props.classNameLi);
        <li className={props.classNameLi} onClick={()=>Base.prototype.SwitchPage(props.onClickPageID)}>
          <a href={props.path} className={props.classNameLink}>
            <Dashboard id={props.IconID} />
            <span className={props.classNameSpan}>{t(props.spanText)}</span>
            <audio id={props.IconID + CSSProps.ID.Audio} src={props.clickSound}/>
          </a>
        </li>
     };
}
 
export default NavItem;
